import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
    const cardArray = robots.map((box) =>{
        return( 
        <Card 
        key={box.id} 
        id={box.name} 
        name={box.name} 
        email={box.email}
        />
        );
    })

    return(
    <div>
        {cardArray}
    </div>
    );
}

export default CardList;
